import React, {Component} from 'react';

import './Team.css';


export class Team extends Component {
  render() {
    return (
      <div className="Team">
        <div className="TeamRow col-10 row">
          {this.props.children}
        </div>
      </div>
    );
  }
}


export class TeamMember extends Component {
  render() {
    return (
      <div className="Member col-3">
        <div className="MemberTitle">
          {this.props.title}
        </div>
        <div className="MemberName">
          {this.props.name}
        </div>
        <div className="MemberEmail">
          {this.props.email}
        </div>
      </div>
    );
  }
}
